import React from 'react';

const WelcomeCard: React.FC = () => {
  return (
    <div className="welcome-card" style={{flex: 2, background: '#23243a', color: '#fff', borderRadius: '18px', padding: '32px', display: 'flex', alignItems: 'center', minWidth: 0}}>
        <div style={{flex: 1}}>
            <h2 style={{fontWeight: 700, fontSize: 28}}>Bütçe Yönetimine Hoş Geldin, Muhammed</h2>
            <p style={{margin: '16px 0'}}>Harcamaların ne durumda, bir bakalım mı?</p>
            <div style={{display: 'flex', gap: '12px'}}>
                <button className="btn btn-light">Account purchase</button>
                <button className="btn btn-dark">View features</button>
            </div>
        </div>
        <img src="/assets/images/hero.png" alt="Hoş Geldin" style={{maxWidth: 180, marginLeft: 32}} />
    </div>
  );
};

export default WelcomeCard;
